import React, { Component } from 'react';
import MunLogo from '../images/munLogo.jpg';

export class Education extends Component {
    render() {
        return (
            <div style={main}>
                <h2 style={headingText}>Education</h2>
                <div style={schoolName}>
                    <h1 style={subHeadingText}>Memorial University of Newfoundland</h1>
                    <img src={MunLogo} width={200} height={200} />
                </div>

            </div>

        )
    }

}

const main = {
    display: 'flex',
    flexDirection: 'column',
    height: '100vh',
    backgroundColor: "#ffffff"
};

const headingText = {
    marginLeft: '20px',
    fontSize: '3rem'
}

const subHeadingText = {
    marginLeft: '20px',
}

const schoolName = {
    display: 'flex',
    flexDirection: 'row',
}

export default Education;
